import React from 'react'

export default function Radio() {
  return (
    <div>
      <input type="radio" className="btn-check" name="options" id="option1" autocomplete="off" checked/>
        <label className="btn btn-secondary" for="option1">Checked</label>

        <input type="radio" className="btn-check" name="options" id="option2" autocomplete="off"/>
          <label className="btn btn-secondary" for="option2">Radio</label>

          <input type="radio" className="btn-check" name="options" id="option3" autocomplete="off" disabled/>
            <label className="btn btn-secondary" for="option3">Disabled</label>

          </div>
          )
}
